using System.Collections.ObjectModel;using Avalonia.Controls;using DynamicData;namespace Client.TcpClient;public class DirectoryParse{    private ObservableCollection<string> _listBoxItems;        public DirectoryParse()    {        _listBoxItems = new ObservableCollection<string>();    }    public ObservableCollection<string> StringParse(string concatStr)    {        var strings = concatStr.Split('\n');        foreach (var str in strings)        {            _listBoxItems.Add(str);        }        return _listBoxItems;    }}